import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {createReduxStore, applyMiddleware, compose} from 'redux';
import rootReducer from './store/rootReducer';
import {Provider} from 'react-redux';
import thunk from 'redux-thunk';
import {reduxFirestoreInstance, getFirestore} from 'redux-firestore';
import {reactReduxFirebaseProvider, getFirebase} from 'react-redux-firebase';
import fbConfig from './config/fbConfig'

const rrfConfig = { course: 'courses' } // react-redux-firebase config

const store = createReduxStore(rootReducer,
    compose(
        applyMiddleware(thunk.withExtraArgument({getFirebase, getFirestore})),
        // reduxFirestoreInstance(fbConfig),
        // reactReduxFirebaseProvider(fbConfig)
    )
);

const rrfProps = {
    firebase,
    config: rrfConfig,
    dispatch: store.dispatch,
    createFirestoreInstance // <- needed if using firestore
}


ReactDOM.render(<Provider store={store}><App /></Provider>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
